import React, { memo } from 'react';
import { 
  TrendingUp, 
  TrendingDown, 
  DollarSign, 
  Target, 
  Tag, 
  Eye,
  ArrowRight,
  Award,
  Shield,
  Activity,
  Building2,
  Briefcase,
  PieChart,
  BarChart3,
  Calculator,
  Clock,
  Wallet,
  TrendingUp as Growth
} from 'lucide-react';

const StockDataTable = memo(({ fundSummaries, onFundClick }) => {
  const formatCurrency = (amount) => {
    return new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR',
      minimumFractionDigits: 2,
    }).format(amount || 0);
  };

  const formatPercentage = (value) => {
    if (value == null || isNaN(value)) {
      return 'N/A';
    }
    return `${value.toFixed(2)}%`;
  };

  const getProfitLossColor = (value) => {
    if (value > 0) return 'text-green-600';
    if (value < 0) return 'text-red-600';
    return 'text-gray-600';
  };

  const getProfitLossBgColor = (value) => {
    if (value > 0) return 'bg-gradient-to-r from-green-50 to-emerald-50';
    if (value < 0) return 'bg-gradient-to-r from-red-50 to-rose-50';
    return 'bg-gradient-to-r from-gray-50 to-slate-50';
  };

  const getProfitLossIcon = (value) => {
    if (value > 0) return TrendingUp;
    if (value < 0) return TrendingDown;
    return Activity;
  };

  const getFundIcon = (fund) => {
    if (fund.isEmergency) return Shield;
    if (fund.profitLossPercent > 10) return Award;
    if (fund.profitLossPercent > 0) return Growth;
    return Target;
  };

  const getTagIcon = (tag) => {
    if (!tag) return Tag;

    const tagLower = tag.toLowerCase();
    if (tagLower.includes('equity') || tagLower.includes('growth')) return TrendingUp;
    if (tagLower.includes('debt') || tagLower.includes('bond')) return Shield;
    if (tagLower.includes('hybrid') || tagLower.includes('balanced')) return PieChart;
    if (tagLower.includes('sector') || tagLower.includes('theme')) return Building2;
    if (tagLower.includes('index') || tagLower.includes('etf')) return BarChart3;
    if (tagLower.includes('liquid') || tagLower.includes('overnight')) return Clock;
    if (tagLower.includes('corporate') || tagLower.includes('credit')) return Briefcase;
    if (tagLower.includes('government') || tagLower.includes('gilt')) return Building2;
    if (tagLower.includes('money') || tagLower.includes('market')) return Wallet;
    if (tagLower.includes('tax') || tagLower.includes('saving')) return Calculator;

    return Tag;
  };

  if (!fundSummaries || fundSummaries.length === 0) {
    return (
      <div className="text-center py-16">
        <div className="mb-8">
          <div className="w-20 h-20 mx-auto bg-slate-100 rounded-lg flex items-center justify-center shadow-sm">
            <Target className="w-10 h-10 text-slate-500" />
          </div>
        </div>
        <h3 className="text-xl font-bold text-gray-900 mb-3">No Investments Found</h3>
        <p className="text-gray-600 mb-6 max-w-md mx-auto leading-relaxed">
          Start building your portfolio by searching for mutual funds above
        </p>
        <div className="inline-flex items-center px-4 py-2 bg-slate-100 text-slate-700 rounded-lg shadow-sm">
          <Wallet className="w-4 h-4 mr-2" />
          <span className="font-medium">Ready to invest?</span>
        </div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="bg-gradient-to-r from-slate-800 to-slate-900 rounded-xl p-6 text-white">
        <div className="flex items-center justify-between">
          <div className="flex items-center space-x-4">
            <div className="p-3 bg-white/10 rounded-lg backdrop-blur-sm">
              <PieChart className="w-6 h-6" />
            </div>
            <div>
              <h3 className="text-xl font-bold">Investment Portfolio</h3>
              <p className="text-slate-300 text-sm">Click on any fund to view detailed information</p>
            </div>
          </div>
          <div className="flex items-center space-x-3">
            <div className="p-2 bg-white/10 rounded-lg backdrop-blur-sm">
              <Activity className="w-5 h-5" />
            </div>
            <div className="p-2 bg-white/10 rounded-lg backdrop-blur-sm">
              <BarChart3 className="w-5 h-5" />
            </div>
          </div>
        </div>
      </div>

      {/* Fund Cards Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-2 xl:grid-cols-3 gap-6">
        {fundSummaries.map((fund, index) => {
          const FundIcon = getFundIcon(fund);
          const ProfitLossIcon = getProfitLossIcon(fund.profitLoss);
          const TagIcon = getTagIcon(fund.tag);
          const isProfit = fund.profitLoss > 0;

          return (
            <div
              key={fund.fundId || fund.schemeCode}
              className="bg-white rounded-lg shadow-md hover:shadow-lg transition-all duration-300 hover:scale-105 cursor-pointer group border border-gray-200"
              onClick={() => onFundClick(fund)}
              style={{ animationDelay: `${index * 50}ms` }}
            >
              <div className="p-6">
                {/* Header */}
                <div className="flex items-start justify-between mb-4">
                  <div className="flex items-center space-x-3">
                    <div className={`p-2 rounded-lg ${isProfit ? 'bg-green-600' : 'bg-red-600'} group-hover:scale-110 transition-transform duration-300`}>
                      <FundIcon className="w-5 h-5 text-white" />
                    </div>
                    <div className="flex-1 min-w-0">
                      <h4 className="text-lg font-semibold text-gray-900 group-hover:text-blue-600 transition-colors duration-300 truncate">
                        {fund.name || fund.schemeName}
                      </h4>
                      {fund.isEmergency && (
                        <div className="flex items-center mt-1">
                          <Shield className="w-3 h-3 text-red-500 mr-1" />
                          <span className="text-xs font-medium text-red-600 bg-red-50 px-2 py-1 rounded">
                            Emergency Fund
                          </span>
                        </div>
                      )}
                    </div>
                  </div>
                  <div className="flex items-center space-x-2">
                    <div className="p-1.5 bg-gray-100 rounded group-hover:bg-blue-100 transition-colors duration-300">
                      <Eye className="w-3 h-3 text-gray-600 group-hover:text-blue-600" />
                    </div>
                    <ArrowRight className="w-3 h-3 text-gray-400 group-hover:text-blue-600 group-hover:translate-x-0.5 transition-all duration-300" />
                  </div>
                </div>

                {/* Tag */}
                {fund.tag && (
                  <div className="mb-4">
                    <div className="inline-flex items-center px-2 py-1 bg-slate-100 text-slate-700 rounded text-xs font-medium">
                      <TagIcon className="w-3 h-3 mr-1" />
                      {fund.tag}
                    </div>
                  </div>
                )}

                {/* Financial Data */}
                <div className="space-y-3">
                  {/* Invested Amount */}
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <Wallet className="w-4 h-4 text-gray-500" />
                      <span className="text-sm font-medium text-gray-600">Invested</span>
                    </div>
                    <span className="text-sm font-semibold text-gray-900">{formatCurrency(fund.totalInvested)}</span>
                  </div>

                  {/* Current Value */}
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <Target className="w-4 h-4 text-gray-500" />
                      <span className="text-sm font-medium text-gray-600">Current Value</span>
                    </div>
                    <span className="text-sm font-semibold text-gray-900">{formatCurrency(fund.totalValue)}</span>
                  </div>

                  {/* Profit/Loss */}
                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                      <ProfitLossIcon className="w-4 h-4 text-gray-500" />
                      <span className="text-sm font-medium text-gray-600">P&L</span>
                    </div>
                    <div className="text-right">
                      <div className={`text-sm font-semibold ${getProfitLossColor(fund.profitLoss)}`}>
                        {formatCurrency(fund.profitLoss)}
                      </div>
                      <div className={`inline-flex items-center px-2 py-0.5 rounded text-xs font-medium ${getProfitLossBgColor(fund.profitLossPercent)} ${getProfitLossColor(fund.profitLossPercent)}`}>
                        {formatPercentage(fund.profitLossPercent)}
                      </div>
                    </div>
                  </div>
                </div>

                {/* Performance Indicator */}
                <div className="mt-4 pt-3 border-t border-gray-100">
                  <div className="flex items-center justify-between">
                    <span className="text-xs text-gray-500">Performance</span>
                    <div className="flex items-center space-x-1">
                      {isProfit ? (
                        <>
                          <TrendingUp className="w-3 h-3 text-green-500" />
                          <span className="text-xs font-medium text-green-600">Growing</span>
                        </>
                      ) : (
                        <>
                          <TrendingDown className="w-3 h-3 text-red-500" />
                          <span className="text-xs font-medium text-red-600">Declining</span>
                        </>
                      )}
                    </div>
                  </div>
                </div>
              </div>
            </div>
          );
        })}
      </div>

      {/* Footer */}
      <div className="bg-slate-50 rounded-lg p-4 text-center">
        <div className="flex items-center justify-center space-x-2 text-gray-600">
          <Activity className="w-4 h-4" />
          <span className="text-sm">Click on any fund to view detailed information</span>
        </div>
      </div>
    </div>
  );
});

StockDataTable.displayName = 'StockDataTable';

export default StockDataTable;
